const Item = (props) => {
	const v = props.details
	return (<>
		<div class="bg-red-100 rounded-xl my-5 p-3">
			<ul>
				<li>{v.name}</li>
				<li>{v.type}</li>
				<li>{v.price}</li>
			</ul>
		</div>
	</>);
}
 
export default Item;
